import Control.Parallel

parallelMap :: (a -> b) -> [a] -> [b]
parallelMap _ [] = []
parallelMap f (x:xs) = par x (nf1 : parallelMap f xs)
                    where nf1 = f x

parallelMapx f (x:xs) = x' `par` (xs `pseq` x':xs')
                where x' = x
                      xs' = parallelMapx f xs

force :: [a] -> ()
force (x:xs) = x `pseq` force xs
force _ = ()

data Tree a = Leaf a
        | Node (Tree a) (Tree a)
         deriving Show

inorder :: Tree a -> [a]
inorder (Leaf a) = []
inorder (Node l r) = inorder l ++ inorder r

depth :: Tree a -> Integer
depth (Leaf a) = 0
depth (Node l r) = 1 + max(depth l) (depth r)

flatten :: Tree a -> [a]
flatten (Leaf a) = [a]
flatten (Node l r) = flatten l ++ flatten r



